import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Header from './src/componentes/Header';
import LoginForm from './src/componentes/LoginForm';
import Saludar from './src/componentes/Saludar';
const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Text style={styles.title} onPress={() =>props.navigation.navigate('Saludar')}>Saludar</Text>
      <Stack.Navigator
        screenOptions={{
          header: ({ navigation }) => <Header />,
        }}>
        <Stack.Screen name="Login" component={LoginForm} />
        <Stack.Screen name="Saludar" component={Saludar} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
